import './Work.css';
import Tilt from 'react-parallax-tilt'
  function Work(props) {
    return (
      <>
        <div className='work'>
          
          <p className="work-header">Work</p>
          
          <div className="web-portfolio">
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              scale={1.05}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card"> 
                <h1>Personal Portfolio</h1>
                <h2> React - GSAP - Express</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              transitionSpeed={1500}
              scale={1.05}
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>COVID-19 Variant Analysis</h1>
                <h2>Bash - GATK - BWA - NextClade - Pangolin</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              transitionSpeed={1500}
              scale={1.05}
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>Type 1 Diabietes Three Country Cohort Anlysis </h1>
                <h2> R - Kraken - Bracken - Krona - Phyloseq - AmpVis</h2>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              transitionSpeed={1500}
              scale={1.05}
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card">
                <h1>Type 1 Diabietes Three Country Cohort Anlysis </h1>
                <h2> R - Kraken - Bracken - Krona - Phyloseq - AmpVis</h2>
              </div>
              </Tilt>
          </div>
          
        </div>
        
      </>
    );
  }
  
  export default Work;
